func (m *WasmModule) toSlice(ctx context.Context, p uint64) ([]uint64, error) {
	length, err := m.readU32(p)
	if err != nil {
		return nil, err
	}
	data, err := m.readU32(p + 4)
	if err != nil {
		return nil, err
	}
	var ret []uint64
	for i := uint64(0); i < length; i++ {
		p, err := m.readU32(data + 8*i)
		if err != nil {
			return nil, err
		}
		ret = append(ret, p)
	}
	return ret, nil
}

